import './App.css';
import useToken from './login/useToken';
import Menu from "./menu/Menu";
import Adapter from "./adapter/Adapter";
import Login from "./login/Login";
import Show from "./show/Show";
import Navigatebar from "./navigatebar/Navigatebar";
import { Routes, Route } from 'react-router-dom';

function App() {
  // let [APItext, setAPItext] = useState(null)
  // useEffect(() => {
  //   fetch("/api")
  //   .then(response => response.text())
  //       // 4. Setting *dogImage* to the image url that we received from the response above
  //   .then(text => setAPItext(text))
  // },[]);
  // console.log(APItext);
  // const [token, setToken] = useState();
  const { token, setToken } = useToken();

  if(!token) {
    return <Login setToken={setToken} />
  }

  return (
    <div className="wrapper">
      <Navigatebar />
      <div className="content-wrapper">
        <Routes>
          <Route path="/" element={<Menu />} />
          <Route path="/adapter" element={<Adapter />} />
          <Route path="/adapter/800" element={<Show value={"ada800"} />} />
          <Route path="/adapter/700" element={<Show value={"ada700"} />} />
          <Route path="/adapter/600" element={<Show value={"ada600"} />} />
          <Route path="/adapter/500" element={<Show value={"ada500"} />} />
          <Route path="/adapter/300" element={<Show value={"ada300"} />} />
          <Route path="/adapter/200" element={<Show value={"ada200"} />} />
          <Route path="/adapter/legacy" element={<Show value={"legacy"} />} />
        </Routes>
      </div>
    </div>
  )
}

export default App;
